    "my_experience_with_winsbank_is_very_accommodating_for_they_have_online_banking": "ປະສົບການຂອງຂ້ອຍກັບ WinsBank ແມ່ນດີຫຼາຍເພາະວ່າພວກເຂົາມີເວທີການທະນາຄານແລະການປ່ອຍເງິນກູ້ ອອນລາຍ. ເມື່ອຂ້ອຍຕ້ອງການເງິນກູ້, ມັນສາມາດເຮັດໄດ້ຢ່າງສະດວກສະບາຍ. ຂ້ອຍບໍ່ຄ່ອນມີເວລາ, ແລະລະບົບສາມາດຕອບສະໜອງຄວາມຕ້ອງການຂອງຂ້ອຍໄດ້ທັນທີ. ຕ້ອງ “ຂອບໃຈ” ສຳລັບການຮັກສາການບໍລິການລູກຄ້າທີ່ດີເລີດແລະຜະລິດຕະພັນການທະນາຄານອອນລາຍທີ່ດີ.",
    "as_a_first_time_customer_i_were_greeted_with_friendly": "ໃນຖານະເປັນລູກຄ້າຜູ້ທຳອິດ, ຂ້ອຍໄດ້ຮັບການຕ້ອນຮັບດ້ວຍເຮັດທຸລະກຳການກູ້ຢືມແບບມືອາຊີບແລະເປັນມິດຂອງແພັດຟອມ. WinsBank ໄດ້ດູແລຄວາມຕ້ອງການການປ່ອຍເງິນກູ້ຂອງຂ້າພະເຈົ້າທີ່ດີທີ່ສຸດພ້ອມດ້ວຍການກູ້ຢືມທີ່ໜ້າສົນໃຈ. ຂ້ອຍຫວັງວ່າຈະໃຊ້ບໍລິການຕໍ່ໄປຢູ່ທະນາຄານນີ້.",
    "i_have_tried_many_banks_and_have_found_that_working": "ຂ້ອຍໄດ້ທົດລອງຫລາຍທະນາຄານແລະພົບວ່າ WinsBank ແມ່ນເວທີທີ່ມີຄວາມເປັນມືອາຊີບແລະໂປ່ງໃສທີ່ສຸດທີ່ຂ້ອຍເຄີຍໃຊ້. ຂ້ອຍຈະຊຸກຍູ້ໃຫ້ທຸກຄົນໃຊ້ແພັດຟອມ WinsBank.",
    "i_thought_i_would_never_be_able_to_retire": "ຂ້ອຍຄິດວ່າຂ້ອຍຈະບໍ່ສາມາດອອກກິນເບ້ຍບຳນານ, ແຕ່ວ່າ eShare ກໍ່ໃຫ້ຄວາມຫວັງແກ່ຂ້ອຍ. ຜົນຕອບແທນທີ່ແທ້ຈິງແມ່ນເກີນຄວາມຄາດຫວັງຂອງຂ້ອຍ, ແລະຂ້ອຍກໍ່ມີຄວາມສຸກກັບການອອກກິນເບ້ຍ ບຳນານຄັ້ງທຳອິດ. ຂ້າພະເຈົ້າດີໃຈຫລາຍທີ່ໄດ້ຊື້ eShare ແລະໄດ້ຮັບຜົນກຳໄລຢ່າງຕໍ່ເນື່ອງເຊິ່ງເປັນການສ້າງການເຕີບໂຕທີ່ໝັ້ນຄົງສຳ ລັບກອງທຶນບຳນານຂອງຂ້ອຍ.",
    "i_am_a_decisive_investor__where_else_these_days": "ຂ້ອຍເປັນນັກລົງທືນທີ່ບໍ່ສາມາດຄາດເດົາໄດ້. ມີບ່ອນໃດນອກເໜືອ ຈາກ WinsBank ທີ່ທ່ານສາມາດໄດ້ຮັບຜົນຕອບແທນປະຈຳປີ 20-25% ໃນການລົງທືນຂອງທ່ານດ້ວຍຄວາມສ່ຽງໜ້ອຍທີ່ສຸດ, ໃນຂະນະທີ່ຮັກສາການ ຄວບຄຸມຊັບສິນຂອງທ່ານແລະຫລີກລ້ຽງການຕັດຄໍຢູ່ເລື້ອຍໆ? ຂ້າພະເຈົ້າມີຄວາມຍິນດີທີ່ໄດ້ມີ eShare ເປັນຊັບສິນຕົ້ນຕໍໃນຫຼັກຊັບຂອງຂ້າພະເຈົ້າ, ແລະມັນຍັງຢູ່ໃນທ່າມກາງການເຕີບໃຫຍ່ຂະຫຍາຍຕົວ.",
    "thanks_for_introducing_me_to_valuable_stocks": "ຂໍຂອບໃຈສຳລັບການແນະນຳຂ້ອຍເຂົ້າຮຸ້ນທີ່ມີຄ່າຂອງຂ້ອຍ. ການລົງທືນໃນ eShare ແມ່ນງ່າຍຕໍ່ການຈັດການແລະເຮັດໄດ້ດີ. ຂ້ອຍໄດ້ເຫັນຜົນຕອບແທນຈາກການລົງທືນຂອງຂ້ອຍ.",
