    "for_eshare_conversion_of_investment_package_started": "ດ້ວຍແພັກເກັດການລົງທືນທີ່ປ່ຽນເປັນແພັກເກັດ eShare ເລີ່ມຕົ້ນກ່ອນວັນທີ 11 ພະຈິກ 2019",
    "after_you_have_successfully_converted_into_eshare_package": "ຫຼັງຈາກທີ່ທ່ານໄດ້ແລກປ່ຽນແພັກເກັດ eShare ສຳເລັດແລ້ວ, ຜູ້ອ້າງອີງຂອງທ່ານຈະໄດ້ຮັບຄ່ານາຍໜ້າໂດຍອີງຕາມຈຳນວນເງິນຂອງ WIN ທີ່ທ່ານເຄີຍໃຊ້ໃນການຊື້ຊຸດການລົງທືນ (ບໍ່ແມ່ນມູນຄ່າຂອງແພັກເກັດ eShare ທີ່ໄດ້ແລກປ່ຽນ).",
    "for_example_if_you_purchased_the_$1000_investment_package": "ຕົວຢ່າງ: ຖ້າທ່ານຊື້ແພັກເກັດການລົງທືນ $ 1000 ໃນຊ່ວງໂປໂມຊັ່ນດ້ວຍສ່ວນຫຼຸດ 5%, ທ່ານຈ່າຍພຽງແຕ່ $950 WIN ($950) ສຳລັບແພັກເກັດການລົງທືນ $1000. ດັ່ງນັ້ນ, ເມື່ອແລກປ່ຽນແພັກເກັດການລົງທືນ $1000 ຂອງທ່ານໃຫ້ເປັນແພັກເກັດ eShare $1000, ຜູ້ອ້າງອີງຂອງທ່ານຈະໄດ້ຮັບດອກຕົວແທນໂດຍອີງໃສ່ຈຳນວນຕົວຈິງທີ່ທ່ານຈ່າຍ ($950). ນີ້ແມ່ນດອກຕົວແທນ eShare ແລະທ່ານສາມາດເບິ່ງລາຍລະອຽດຂອງດອກຕົວແທນ eShare ໄດ້ທີ່ນີ້ <a href='{linkToLinkEshare}' target='_blank'>here</a>",
    "for_eshare_conversion_of_investment_package_after": "ດ້ວຍແພັກເກັດການລົງທືນທີ່ແລກປ່ຽນເປັນແພັກເກັດ eShare ເລີ່ມແຕ່ວັນທີ 11 ພະຈິກ 2019",
    "your_referrer_wont_receive_eshare_commission": "ຜູ້ອ້າງອີງຂອງທ່ານຈະບໍ່ໄດ້ຮັບດອກຕົວແທນ eShare.",
    "package_payout_stopped": "ການຊຳລະທີ່ໄດ້ຮັບ: ຢຸດການຮັບ.",
    "cancel_package_after_paying": "ຍົກເລີກແພັກເກັດ (ຫຼັງຈາກຈ່າຍຄ່າທຳນຽມທີ່ຈຳເປັນທັງໝົດ)",
    "you_can_cancel_at_any_time_during_the_investment_period": "ທ່ານສາມາດຍົກເລີກແພັກເກັດດັ່ງກ່າວໄດ້ທຸກເວລາໃນໄລຍະການລົງທືນ. ການເລືອກຕົວເລືອກນີ້ຈະຊິ້ນສຸດແພັກເກັດການລົງທືນໃນປະຈຸບັນຂອງທ່ານແລະຢຸດການຮັບເງິນທັນທີທີ່ກົດປຸ່ມ. ທ່ານຈະຕ້ອງຈ່າຍຄ່າທຳນຽມຍົກເລີກ, ຄ່າດອກຕົວແທນທີ່ກ່ຽວຂ້ອງແລະການຈ່າຍເງິນທັງໝົດທີ່ໄດ້ຮັບຈາກແພັກເກັດການລົງທືນຂອງປະຈຸບັນ. ທ່ານຈະໄດ້ຮັບຜົນປະໂຫຍດຫຼາຍຖ້າທ່ານປ່ຽນແພັກເກັດການລົງທືນຂອງທ່ານເຂົ້າໃນແພັກເກັດ eShare (ເບິ່ງເພີ່ມເຕີມ <a href='/supports/faq-details/how-can-I-convert-my-investment-package-to-eShare-package' target='_blank'>ທີ່ນີ້</a>)",
    "you_can_find_more_specific_details": "ທ່ານສາມາດຊອກຫາຂໍ້ມູນສະເພາະເຈາະຈົງກ່ຽວກັບລະບົບການລົງທືນຂອງພວກເຮົາ <a href='http://news.winsbank.io/a-glance-at-the-most-innovative-investment-system-of-wins-fund/' target='_blank'>ທີ່ນີ້</a>",
    "after_your_investment_package_ends": "ຫຼັງຈາກແພັກເກັດການລົງທືນຂອງທ່ານສິ້ນສຸດລົງ, ກະລຸນາເຂົ້າໄປທີ່ <a href='/package' target='_blank'>https://winsbank.io/package</a> ແລະຊອກຫາແພັກເກັດປະຈຸບັນຂອງທ່ານ. ທ່ານສາມາດເບິ່ງ 3 ທາງເລືອກ: ການຕໍ່ອາຍຸ, ແລກປ່ຽນ ESR, ແລະຍົກເລີກແພັກເກັດ.",
    "release_package_only_available_for_21_days": "ຍົກເລີກເລີກແພັກເກັດ (ໃຊ້ໄດ້ສະເພາະໃນ 21 ວັນ: 14 ມື້ກ່ອນວັນໝົດອາຍຸແລະ 7 ມື້ຫຼັງຈາກວັນໝົດອາຍຸ, ຫລັງຈາກນັ້ນ, ທ່ານຈຶ່ງສາມາດຕໍ່ອາຍຸໄດ້, ແລກປ່ຽນ ESR ຫຼືຍົກເລີກແພັກເກັດ)",
    "you_will_end_the_current_investment_package": "ເມື່ອເລືອກຕົວເລືອກນີ້, ທ່ານຈະຊິ້ນສຸດແພັກເກັດການລົງທືນໃນປະຈຸບັນຂອງທ່ານແລະຢຸດຮັບການຊຳລະເງິນທັນທີທີ່ກົດປຸ່ມ. ທ່ານສາມາດໄດ້ຮັບການລົງທືນໃນເບື້ອງຕົ້ນຂອງທ່ານໃນວັນໝົດອາຍຸແລະເລີ່ມຕົ້ນແພັກເກັດການລົງທືນໃໝ່ຖ້າທ່ານຕ້ອງການ.",
