    "you_can_convert_your_investment_package_to_an_eshare_package": "ທ່ານສາມາດແລກປ່ຽນແພັກເກັດການລົງທືນຂອງທ່ານໃຫ້ເປັນແພັກເກັດ eShare ທີ່ມີມູນຄ່າແລະ <u>ຮັບ 10% ມູນຄ່າຂອງແພັກເກດ eShare ກະເປົ໋າ Gift</u> ທຸກເວລາ, ເບິ່ງລາຍລະອຽດເພີ່ມເຕີມກ່ຽວກັບວິທີເຮັດມັນ <a href='/supports/faq-details/what-can-I-do-after-my-investment-package-ends' target='_blank'>ທີ່ນີ້</a>",
