    "you_have_successfully_purchase_eshare_package": "ທ່ານໄດ້ຊື້ແພັກເກັດ eShare ສຳເລັດແລ້ວ. ໄປທີ່ <a href='/user/eshare-balance' target='_blank'>http://winsbank.io/user/eshare-balance</a> ເພື່ອເບິ່ງຍອດ eShare ຂອງທ່ານ",
    "full_payment_allows_you_to_make_payment": "ການຊຳລະເງິນຄົບເຕັມຈຳນວນອະນຸຍາດໃຫ້ທ່ານຈ່າຍເງີນ 100% ສຳລັບມູນຄ່າຂອງແພັກເກັດ ແລະໄລຍະເວລາລັອກຈະເລີ່ມຕົ້ນໃນທັນທີ. 50% ຂອງມູນຄ່າ eShare ຂອງທ່ານຈະຖືກປົດລັອກທຸກໆ 6 ເດືອນຈາກໄລຍະເວລາລັອກ.",
    "installment_payment_allows_you_purchase_eshare": "ການຜ່ອນຊຳລະຊ່ວຍໃຫ້ທ່ານສາມາດຊື້ແຜນ eShare ແລະຊຳລະລາຍເດືອນໄດ້ໂດຍດອກເບ້ຍ 0%. ມີ 3 ທາງເລືອກໃນການຈ່າຍດາວ: ຈ່າຍ 10% ຕໍ່ເດືອນເປັນເວລາ 10 ເດືອນ, ຈ່າຍ 5% ຕໍ່ເດືອນເປັນເວລາ 20 ເດືອນ, ຈ່າຍ 2% ຕໍ່ເດືອນເປັນເວລາ 50 ເດືອນ.",
    "eshare_code_will_only_be_6_month": " <span class='bgYellow'>ແລະທ່ານບໍ່ຕ້ອງໃຊ້ລະຫັດ eShare ເພື່ອໃຫ້ໄດ້ຮັບສ່ວນຫຼຸດເມື່ອຊື້ແພັກເກັດດ້ວຍຮູບແບບຜ່ອນດາວ</span>",
