    "loan_agreement_step1": "In this User Agreement, unless the context otherwise requires, the following words and expressions shall bear the following meanings:",
    "loan_agreement_step2": "“Digital Asset” means any digital asset (also known as a “cryptocurrency”, “virtual currency”, “digital currency”, “crypto-tokens”, “virtual tokens”, “digital tokens” or “digital payment tokens”) including but not limited to bitcoin and ether, which is issued, stored and/or transferred based on the protocol of a computer or blockchain network. Such computer or blockchain network may be (i) centralised or decentralised, (ii) permissioned or permissionless and/or (iii) based on closed or open-source software.",
    "loan_agreement_step3": "“Borrower” means any individual, corporation, legal person, entity or other organisation for whom WinsBank is maintaining or continuing to maintain one or more Account(s) for the provision of the Loan Services, including you.",
    "loan_agreement_step4": "“Platform” is an automated technology platform of WinsBank that provides access to loan products using digital assets and investment packages as collaterals. Borrower is a user of Platform and wishes to engage Platform pursuant to the terms of this Agreement. The parties do hereby agree as follows:",
    "loan_agreement_step5": "Borrower authorizes Platform to lock and store collateral in return for a loan using Platform’s loan products using digital assets and investment packages as collaterals. Borrowers must meet the term, amount, and interest rate requirements currently in effect and set forth by WinsBank.",
    "loan_agreement_step6": "Borrower must pay all necessary fees and interests to unlock their collaterals at the end of the loan period (including but not limited to early payment fees, late fees, total interests and other fees).",
    "loan_agreement_step7": "All collateral deposits by Borrower shall be locked for the duration of the loan term. Until full payment is made (including fees and interests), user cannot access the previously locked collateral.",
    "loan_agreement_step8": "Platform strictly requires every loan to be fully backed by an equivalent amount of collateral. For loans using digital assets as collaterals, borrower can borrow a maximum amount of 60% of their collaterals. For loans using investment packages as collateral, borrower can borrow a maximum amount of 30% of their collaterals.",
    "loan_agreement_step9": "Under these two types of conditions, your loan will be automatically cancelled and your collaterals will be liquidated. There is no way to recover this automatic cancellation.",
    "loan_agreement_step10": "1. Liquidation price reached: When the price of your locked crypto asset reaches the <b>“Force Liquidation Value”</b>, your locked amount will be sold at market price and your loan will be cancelled. You will lose your collateral assets and still keep the money you borrowed. <b>“Force Liquidation Value”</b> is the price of the crypto asset at which your collateral value decrease 30% from the collateral value at the beginning of the loan.",
    "loan_agreement_step11": "2. Overdue for more than 30 days.<br/>Your loan will have a due date on which you have to make full payment for your loan (including all loan interests and fees). If you fail to make full payment on the due date, your loan will become overdue and you have to pay daily overdue fees. After more than 30 days of overdue, your loan will be cancelled. You will lose your collateral assets and still keep the money you borrowed.",
    "loan_agreement_step12": "There are no agreements between the parties that are not set forth in this Agreement.",
    "loan_agreement_step13": "This Agreement does not create an employer-employee relationship, advisor-borrower relationship, joint venture or partnership between Borrower and Platform.",
    "loan_agreement_step14": "At the time of borrowing, the most recent terms and conditions will apply, for the entire duration of the loan term. WinsBank reserves the right to revise the terms of this agreement at any time, without notice, which will be applicable to loans issued at and after the time of revision. Borrowers are encouraged to review these terms on a regular basis.",
    "loan_agreement_step15": "Constant may communicate these terms and conditions in a variety of methods, including by email or posting on our website or blog.",
    "loan_agreement_step16": "By accepting a matched loan, you acknowledge that you have adequately considered the relevant interest rate and found it not usurious under the laws governing this Loan Agreement.",
    "loan_agreement_step17": "As an effect of this acknowledgement, you are also confirming that even though your claims for protection against usurious loans have not been waived, you have no reasonable intention to file a claim of usury against WinsBank and its related users/partners under the laws governing this Loan Agreement, and will protect WinsBank and its related users/partners to the best of your ability, against any claims of usury made with regards to the loan that you are undertaking.",
