    "highly_recommended_a_great_experience": "“ຂ້າພະເຈົ້າຂໍແນະນຳໃຫ້ຊື້ຂາຍໃນ Wefinex ຂໍຂອບໃຈກັບປະສົບການທີ່ດີ. ການຊື້ຂາຍແມ່ນງ່າຍດາຍແລະງ່າຍຕໍ່ການດຳ ເນີນງານດ້ວຍພຽງສອງສາມຂັ້ນຕອນ. ແພັດຟອມ Wefinex ສະ ໜັບສະໜູນສະກຸນເງິນທົ່ວໄປແລະຂັ້ນຕອນການຝາກເງິນແລະການຖອນເງິນກໍ່ແມ່ນຂາວສະອາດ!”",
    "i_finally_know_what_its_like_to_live": "“ໃນທີ່ສຸດຂ້ອຍສາມາດຫາກຳໄລໄດ້ຈາກການເຮັດທຸລະກຳເງິນຕາ. ນອກຈາກນັ້ນ, ຂ້ອຍບໍ່ຕ້ອງຕິດຕາມບັນຊີກ່ຽວກັບ Tradingview ອີກຕໍ່ໄປເພື່ອຮຽນຮູ້ວິທີການຄ້າ. Wefinex.net ໄດ້ອະນຸຍາດໃຫ້ຂ້າພະເຈົ້າໃຊ້ເວລາຫລາຍຂື້ນຍ້ອນການຫາກຳໄລໃນເວລາຊື້ຂາຍ.”",
    "surprisingly_i_used_to_be_an_investor": "“ເປັນສິ່ງທີ່ແປກໃໝ່, ຂ້ອຍເຄີຍເປັນນັກລົງທືນຢູ່ Wall Street. ແລະຂ້ອຍກໍ່ບໍ່ເຄີຍເຫັນສິ່ງດັ່ງກ່າວໃນເວລາປະມານ 10 ປີຂອງຂ້ອຍຢູ່ທີ່ບໍລິສັດ. ເພື່ອນຮ່ວມງານຂອງຂ້ອຍລ້ວນແຕ່ຄິດວ່າຂ້ອຍບ້າທີ່ຈະອອກຈາກບໍລິສັດໄປລົງທືນກັບເວທີ Wefinex.net ກັບເວລາທັງໝົດ. ເຖິງຢ່າງໃດກໍ່ຕາມ, ແພັດຟອມດັ່ງກ່າວມີກຳໄລໄດ້ $55/ມື້, ແລະເພື່ອນຮ່ວມງານທັງໝົດຂອງຂ້ອຍທີ່ກຳລັງເຮັດວຽກເລີ່ມຕົ້ນຂໍໃຫ້ຂ້ອຍຊີ້ນຳພວກເຂົາຮ່ວມ.”",
    "two_weeks_ago_i_got_laid_off": "“ສອງອາທິດກ່ອນ, ຂ້ອຍຕົກງານ. ບໍ່ມີທາງເລືອກອື່ນ, ຂ້ອຍຄິດວ່າຊີວິດຂ້ອຍຈົບລົງແລ້ວ. ດຽວນີ້ຂ້ອຍຫາເງິນໄດ້ຫລາຍກວ່າ 40 ໂດລາຕໍ່ມື້. ແລະເປັນຄັ້ງທຳອິດໃນ 2 ເດືອນ, ບັນຊີຂອງຂ້ອຍບໍ່ໄດ້ຂາດເງິນ. ຂໍຂອບໃຈ, Wefinex.net!”",
