    "sys_notification": "<p>ຕາຕະລາງອັບເດດແລະຍົກລະດັບສຳລັບສຳເນົາການເຮັດທຸລະກຳ</p><p>ຟັງຊັ່ນຄັດລອກເຮັດທຸລະກຳຂອງ Wefinex ແມ່ນກຳ ນົດໃຫ້ມີການອັບເດດແລະຍົກລະດັບ 14 ວັນໂດຍເລີ່ມແຕ່ວັນທີ 28 ເດືອນກໍລະກົດປີ 2020. ທ່ານຈຳເປັນຕ້ອງປິດທຸກສຳເນົາການເຮັດທຸລະກຳຂອງທ່ານໂດຍເວລາ 00:00: 00 (UTC) ວັນທີ 28 ເດືອນກໍລະກົດປີ 2020. ທຸກໆປະເພດສຳເນົາການເຮັດທຸລະກຳຈະຖືກປິດບັງຄັບໂດຍ Wefinex.</p><p>ກະລຸນາຮັບຊາບວ່າການອັບເດດແລະຍົກລະດັບແມ່ນສຳລັບການເຮັດທຸລະກຳສຳເນົາເທົ່ານັ້ນ. ທຸກໆໜ້າທີ່ອື່ນໆໃນ Wefinex ຈະບໍ່ໄດ້ຮັບຜົນກະທົບ.</p><p>* ໝາຍເຫດ: ຈື່ໄວ້ໃນຕາຕະລາງຕໍ່ໄປນີ້:</p><p>ແຈ້ງການສຸດທ້າຍກ່ອນການປິດບັງຄັບ: ວັນທີ 27 ກໍລະກົດ 2020</p><p> ອັບເດດແລະຍົກລະດັບເລີ່ມຕົ້ນ: 00:00:00 (UTC) ວັນທີ 28 ເດືອນກໍລະກົດປີ 2020</p><p>ອັບເດດແລະຍົກລະດັບສຳເລັດແລ້ວ: ເວລາ 00: 00: 00 (UTC) ວັນທີ 11 ສິງຫາ 2020</p>",
