    "lucky_draw_info_guide_content": "<h4>ກົດລະບຽບການຈັບຜູ້ໂຊກດີ</h4><p>Wefinex ມີຄວາມພູມໃຈທີ່ຈະເປີດຕົວໂປໂມຊັ່ນສຸດທ້າຍຂອງພວກເຮົາ: ການຈັບສະຫລາກລາຍວັນ. ເວລາ 00:00:00 (UTC) ທຸກໆມື້, ລະບົບຂອງພວກເຮົາຈະເລືອກເອົາຜູ້ໂຊກດີ 3 ຄົນໂດຍອັດຕະໂນມັດເພື່ອຮັບ 3 iPhone 11 Pro (iPhone 11 Pro Max 64Gb ເທົ່າກັບ 1,000 ໂດລາ).</p><p> ກົດລະບຽບການເຂົ້າຮ່ວມ: ສຳລັ ທຸກໆປະລິມານເຮັດທຸລະກຳ $10, ທ່ານຈະໄດ້ຮັບປີ້ຊິງໂຊກ. ປີ້ຊິງໂຊກສະແດງໂອກາດຂອງທ່ານທີ່ຈະໄດ້ຮັບລາງວັນ. ຜູ້ໃຊ້ທີ່ມີສິດລຸ້ນໂຊກຫຼາຍກວ່າຈະມີໂອກາດໄດ້ຮັບລາງວັນປະຈຳວັນທີ່ໂຊກດີຫຼາຍຂື້ນ. ສະນັ້ນ, ທ່ານຈະເຮັດທຸລະກຳໄດ້ຫຼາຍເທົ່າໃດ, ທ່ານກໍ່ຈະມີໂອກາດຊະນະເທົ່ານັ້ນ.</p><p>ຜູ້ໃຊ້ແຕ່ລະຄົນສາມາດໄດ້ iPhone ພຽງແຕ່ 1 ໜ່ວຍ ຕໍ່ມື້ເທົ່ານັ້ນ. ຜູ້ໂຊກດີທຸກໆວັນກ່ອນແມ່ນມີສິດເຂົ້າຮ່ວມໃນການຈັບສະຫລາກລາຍວັນໂຊກດີຕໍ່ໄປ. ຈຳນວນປີ້ໂຊກຈະນັບໃໝ່ໂດຍອັດຕະໂນມັດຕັ້ງແຕ່ເລີ່ມຕົ້ນເວລາ 00:00:00 (UTC) ໃນແຕ່ລະມື້ (ຈຳນວນປີ້ຕໍ່ມື້ແມ່ນອີງໃສ່ປະລິມານການເຮັດທຸລະກຳໃນມື້ນັ້ນ). ດ້ວຍ Wefinex Daily Lucky Draw, ທຸກໆມື້ທ່ານມີໂອກາດໃໝ່ທີ່ຈະໄດ້ຮັບລາງວັນ iPhone!</p><p>ວິທີທີ່ຜູ້ໂຊກດີຈະໄດ້ຮັບລາງວັນຂອງພວກເຂົາ: ພາຍໃນ 24 ຊົ່ວໂມງຂອງລາງວັນຜູ້ໂຊກດີ, ພວກເຂົາຈະໄດ້ຮັບລາງວັນ 1,000 WIN ເຂົ້າໃນບັນຊີ WIN.</p>",
