    "join_site_exchange": "ເຂົ້າຮ່ວມ {site}.",
    "deniex_earn_unlimited_trading_income_as_well_as_passive_income_today": "ລົງທະບຽນແລະເລີ່ມຕົ້ນຫາລາຍໄດ້ໃນມື້ນີ້!",
    "testimonial_1": "“{site} ແມ່ນແພລະຕະຟອມ ໃໝ່ ທີ່ມີການປະຕິວັດເຊິ່ງເຮັດໃຫ້ການຄ້າງ່າຍແລະມີ ກຳ ໄລ ສຳ ລັບຄວາມ ຊຳ ນານທຸກລະດັບ. ພວກເຂົາຕ້ອງການທີ່ຈະເປັນບ່ອນທີ່ດີທີ່ສຸດ ສຳ ລັບທຸກຄົນ, ຕັ້ງແຕ່ເລີ່ມຕົ້ນຈົນເຖິງຜູ້ຊ່ຽວຊານຄືກັນ, ສະນັ້ນພວກເຂົາຮັກສາທຸກຢ່າງທີ່ລຽບງ່າຍແຕ່ມີພະລັງດ້ວຍການບໍລິການລູກຄ້າທີ່ດີ!”",
    "testimonial_2": "“ຂ້ອຍແມ່ນພໍ່ຄ້າ ໃໝ່ ທີ່ຫຍຸ້ງຍາກໃນການສ້າງອາຊີບຂອງຂ້ອຍ. ຂ້ອຍພົບວ່າ {site} ແລະເວທີດັ່ງກ່າວແມ່ນ ໜ້າ ຕື່ນຕາຕື່ນໃຈ! ຕົວຊີ້ວັດໄດ້ຊ່ວຍໃຫ້ຂ້ອຍເຂົ້າໃຈວິທີການຕັດສິນໃຈຊື້ຂາຍທີ່ດີທີ່ສຸດ, ມາຮອດປະຈຸບັນຂ້ອຍໄດ້ຮັບ ກຳ ໄລເຖິງ 128%.”",
    "testimonial_3": "“ໂດຍການຊ່ວຍເຫຼືອຂອງ {site}, ຂ້ອຍບໍ່ໄດ້ໃຊ້ເວລາດົນທີ່ຈະກາຍເປັນພໍ່ຄ້າ. ແພລະຕະຟອມແມ່ນໃຊ້ໄດ້ງ່າຍແລະໃຊ້ງ່າຍດ້ວຍຕົວຊີ້ວັດທີ່ມີປະໂຫຍດຫຼາຍເຊິ່ງຊ່ວຍໃຫ້ຂ້ອຍສາມາດຕັດສິນໃຈໄດ້ໄວ.”",
