    "expiration_day": "ໝົດອາຍຸວັນທີ",
    "airdrop_rules_description_0": "ເພື່ອໃຫ້ລາງວັນແກ່ຜູ້ໃຊ້ທີ່ເຮັດທຸລະກຳຢ່າງຕັ້ງໜ້າໃນເວທີຂອງພວກເຮົາຕັ້ງແຕ່ມື້ທຳອິດ, ພວກເຮົາຈະຈັດເຫດການ Airdrop (ໃຫ້ຟຣີເຫດການ) ເພື່ອແບ່ງປັນ ALI ໃຫ້ແກ່ສະມາຊິກທັງໝົດ ຂ້າງເທິງຈຳນວນລວມການເຮັດທຸລະກຳ ຂອງທ່ານໃນເວລາທີ່ Snapshot. ຫຼັກການແບ່ງປັນ Airdrop ດັ່ງຕໍ່ໄປນີ້:",
    "airdrop_rules_description_1": "1. ສະມາສິດທັງໝົດທີ່ມີລວມທັງໝົດການເຮັດທຸລະກຳຢ່າງໜ້ອຍແມ່ນ 1000$ ໃນເວທີຂອງພວກເຮົາລ້ວນແຕ່ມີສິດໄດ້ເຂົ້າຮ່ວມໃນເຫດການ Airdrop. ຈຳນວນແບ່ງປັນຈະໄດ້ຄິດໄລຂ້າງເທິງໃນຈຳນວນລວມການເຮັດທຸລະກຳ ຂອງທ່ານໃນເວລາທີ່ Snapshot.",
    "airdrop_rules_description_2": "2. \"Snapshot\" (ຖ່າຍຂໍ້ມູນ)ແມ່ນວິທີການສະຫຼຸບຂ້າງເທິງຈຳນວນລວມການເຮັດທຸລະກຳຂອງທ່ານໃນໃນຈຸດເວລາທີ່ແນ່ນອນຂອງມື້. \"ຈຳນວນລວມການເຮັດທຸລະກຳ ໃນເວລາທີ່ Snapshot\" ແມ່ນຈຳນວນການເຮັດທຸລະກຳຂອງທ່ານໄດ້ຄິດໄລ່ແຕ່ 00:00:00 (UTC) 01/01/2021 ເຖິງເວລາ Snapshot.",
    "airdrop_rules_description_3": "3. ຈະມີທັງໝົດ 5.000.000 ALI ໃນເຫດການ Aridrop ນີ້. 5.000.000 ALI ຈະໄດ້ແບ່ງປັນຢ່າງສະເໝີພາບລະຫວ່າງສະມາສິດທຸກຄົນໃນເວທີຂອງພວກເຮົາ ຂ້າງເທິງຈຳນວນລວມການເຮັດທຸລະກຳ ຂອງທ່ານໃນເວລາທີ່ Snapshot",
    "airdrop_rules_description_4": "4. ALI ທັງໝົດ ຍັງບໍ່ທັນໄດ້ຮັບຈະໝົດກຳນົດເວລາໃນວັນໝົດອາຍຸ, ໝາຍຄວາມວ່າ ຮອດມື້ນີ້ຕໍ່ໄປ, ທ່ານບໍ່ສາມາດຮຽກຮ້ອງເພື່ອຮັບ ALI ໃນເຫດການ Aridrop ນີ້ອີກ",
    "airdrop_rules_description_5": "5. ຫຼັງຈາກເຫດການ Airdrop ນີ້ສຳເລັດ, ທ່ານກໍຍັງໄດ້ຮັບ ALI ຂ້າງເທິງຈຳນວນລວມການເຮັດທຸລະກຳ ຂອງທ່ານ. ຈຳນວນ ALI ນີ້ບໍ່ກ່ຽວຂ້ອງກັບເຫດການ Airdrop ທີ່ໄດ້ສຳເລັດ ແລະ ຈະໄດ້ສົ່ງໂດຍກົງໃສ່ກະເປົາເງິນລາງວັນຂອງທ່ານ.",
    "airdrop_rules_description_6": "6. ຈຳນວນ ​ALI ໃນກະເປົາເງິນລາງວັນຂອງທ່ານ ບໍ່ໝົດອາຍຸຄືຈຳນວນ ALI ຂອງທ່ານທີ່ໄດ້ຮັບໃນເຫດການ Airdrop. ແຕ່ທ່ານຕ້ອງກົດປຸ່ມ \"ຮັບທັງໝົດ\" ເພື່ອລະບົບສົ່ງ ALI ຮອດກະເປົາເງິນຫຼັກ ແລະ ຫຼັງຈາກນັ້ນ ທ່ານສະມາດໃຊ້ ຫຼື ຖອນ ALI ຕາມທີ່ທ່ານຕ້ອງການ",
    "upgrade_vip_success": "ທ່ານໄດ້ຍົກລະດັບລະດັບ VIP ສຳ ເລັດແລ້ວ.",
    "upgrade_vip_des": "ຊັ້ນ VIP ຂອງທ່ານຫຼັງຈາກທ່ານກາຍເປັນສະມາຊິກ VIP ຊັ້ນທີ 1. ເພື່ອສາມາດຍົກລະດັບຂັ້ນ VIP, ທ່ານຕ້ອງຈ່າຍຄ່າຍົກລະດັບ ແລະ ມີຈໍານວນ F1 ພຽງພໍໃນເວລາໄດ້ຊື້ເປັນສະມາຊິກ VIP. ໃນເວລາ00:00:00 (UTC) ທຸກໆວັນທິດ, ຊັ້ນ VIP ໃນເວລາທ່ານຍົກລະດັບແມ່ນຈະໝົດອາຍຸ, ຊັ້ນໃໝ່ຂອງທ່ານໄດ້ຍົກລະດັບອີງໃສ່ຈໍານວນການແລກປ່ຽນໃນທຸກອາທິດຂອງ F1 ແລະ F1 ໄດ້ຊື້ຈໍານວນສະມາຊິກ VIP ໃນເວລາ 7 ມື້ທີ່ຜ່ານມາ.",
